subproject.description:
Project outputs:
- Strengthened environmental governance provides a more sustainable landuse context for the PA system;
- New management practices are introduced and capacity built in target PAs; overall management effectiveness and sustainability of the PA system substantively improved;
- Practical examples for stakeholders of how to achieve environmentally sustainable livelihoods around target PAs

